import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Electronics');

    // Take screenshot after filling search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input_filled.png'));

    // Click on the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Take screenshot after clicking search button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for the cart to be updated
    await page.waitForSelector('.cart', { timeout: 5000 });

    // Take screenshot of the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_updated.png'));

    // Click on the checkout button
    await page.waitForSelector('.checkout-btn', { timeout: 5000 });
    await page.click('.checkout-btn');

    // Take screenshot after proceeding to checkout
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_proceeded_to_checkout.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_proceeded_to_checkout.png'));

    return {
      success: true,
      action: "Successfully performed rapid cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
